from collections import defaultdict

def solve():
    n = int(input())
    arr = list(map(int, input().split()))
    
    # Calculate all possible sums that can be generated by subsets of the given set.
    dp = [0] * (sum(arr) + 1)
    for num in arr:
        for i in range(sum(arr), -1, -num):
            dp[i] += 1
    
    return ' '.join(map(str, dp))

print(solve())
